import React from 'react'
import s from "./Users.module.css";
import userPhoto from "../../img/rik.jpg";
import {NavLink} from "react-router-dom";
import Paginator from "../Common/Paginator/Paginator";
import User from "./User";

let Users = ({TotalCount,PageSize,SetUserPage,currentPage,...props}) => {
    return <div>
     <Paginator TotalCount={TotalCount} PageSize={PageSize} SetUserPage={SetUserPage} currentPage={currentPage} />
        {
            props.Users.map(u => <User user={u}
                                       isfetchingprogress={props.isfetchingprogress} key={u.id} />
              )
        }
</div>
}
export default Users
